                           0 56.68,-25.39725 56.68,-56.67975l0,-71.718Z"/>
            </StyledSvg>
            <Text className='color'>Scroll down</Text>
            <ScrollArrow className="uil uil-arrow-down home__scroll-arrow"></ScrollArrow>
        </Container>
    );
};

export default ScrollDown;
